T.b.v. de plezier- en de passagiersvaart zullen in 2006 de kunstwerken op het Kanaal Bocholt-Herentals, de Zuid-Willemsvaart en het Kanaal Briegden-Neerharen op de volgende zon- en feestdagen worden bediend van 10:00 tot 18:00:
1. op zondagen vanaf 7 mei t/m 24 september;
2. maandag 1 mei (Feest van de Arbeid);
2. donderdag 25 mei (O.L.H. Hemelvaart);
3. maandag 5 juni (Tweede Pinksterdag);
4. vrijdag 21 juli (Nationale Feestdag);
5. dinsdag 15 augustus (O.L.V.-Hemelvaart).
(E-mailber. N.V. De Scheepvaart Afd. Exploitatie, nr. 6/2006)

